import React, { Fragment } from "react";
import styled from "styled-components";

const Wrapper = styled.section`
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
	font-family: "Quicksand";
`;

const WrapperLogin = styled.div`
	margin-top: 25px;
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
`;

const Cuenta = styled.p`
	font-size: 15px;
`;

const LinkLogin = styled.a`
	color: blue;
	font-size: 16px;
`;

const ImageFooter = styled.img`
	height: auto;
	width: 100vw;
`;

const Home = () => {
	return (
		<Fragment>
			<Wrapper>
				<WrapperLogin>
					<Cuenta></Cuenta>
					<LinkLogin></LinkLogin>
				</WrapperLogin>
				<ImageFooter />
			</Wrapper>
		</Fragment>
	);
};

export default Home;
